import "./AdminDashboard.css";

import { useState, useEffect } from "react";

import { Link, useNavigate } from "react-router-dom";

import axios from "axios";

import { connect } from "react-redux";

const AdminDashboard = ({ getToken, getAdmin }) => {
 
  const navigate = useNavigate();
  const [employees, setEmployees] = useState([]);
  useEffect(() => {
    axios
      .get(
        "http://localhost:4000/admin/getall",
        {
          headers: {
            "Content-Type": "application/json",
            "auth-token": localStorage.getItem("token"),
          },
        }
      )
      .then((response) => {
        setEmployees(response.data);
      });
  });
  const deleteEmployee = (id) => {
    axios.delete(
      `http://localhost:4000/admin/delete/${id}`,
      {
        headers: {
          "Content-Type": "application/json",
          "auth-token": getToken,
        },
      }
    );
  };
  const signOut=()=>
  {
    localStorage.removeItem("token");
    localStorage.removeItem("adminDatafirstName");
    localStorage.removeItem("adminDatalastName");
    navigate("/");
  }
  return (
    <>
      <div className="admin-dashboard">
      <nav class="navbar navbar-expand-lg bg-light">
  <div class="container-fluid">
    <a class="navbar-brand" href="#">Navbar</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNavDropdown">
      <ul class="navbar-nav">
        <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle" href="javascript:void(0)" id="navbarDropdownMenuLink" role="button" data-bs-toggle="dropdown" aria-expanded="false">
            Dropdown link
          </a>
          <ul class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
            <li><a class="dropdown-item" href="#">Action</a></li>
            <li><a class="dropdown-item" href="#">Another action</a></li>
            <li><a class="dropdown-item" href="#">Something else here</a></li>
          </ul>
        </li>
      </ul>
    </div>
  </div>
</nav>
        <div>
          {/* <Link to="/" style={{ color: "blue" }}>
            Home
          </Link> */}
          <Link to="/admin/add" class="btn btn-success">
            Create User
          </Link>
          
        </div>
        
        <h2>All Employees</h2>
        {employees.length === 0 && <p>No Employees</p>}
        {employees.length > 0 && (
          <div className="employee-details">
            <h3>
              <strong>First Name</strong>
            </h3>
            <h3>
              <strong>Last Name</strong>
            </h3>
            <h3>
              <strong>Email</strong>
            </h3>
          </div>
        )}
        {employees.map((employee) => (
          <div key={employee._id} className="employee">
            <div>{employee.firstName}</div>
            <div>{employee.lastName}</div>
            <div>{employee.email}</div>
            <div
              className="edit"
              onClick={() => {
                navigate(`/admin/edit/${employee._id}`);
              }}
            >
              Edit
            </div>
            <div
              className="delete"
              onClick={() => {
                deleteEmployee(employee._id);
              }}
            >
              Delete
            </div>
          </div>
        ))}
        <div>
         
        </div>
      </div>
    </>
  );
};

const mapStateToProps = (state) => {
  return {
    getToken: state.signin.token,
   // getAdmin: state.signin.admin,
   getAdmin:localStorage.getItem("adminData")
  };
};

export default connect(mapStateToProps, null)(AdminDashboard);
